import React, { useState } from 'react';
import './App.css';
import KeyValueTable from './components/KeyValueTable';

const App = () => {
  const [activeTab, setActiveTab] = useState('gpsStatusDict');
  const data = {
    gpsStatusDict: {
      status: false,
      gpsJammingOK: true,
      horizontalAccuracyOK: false,
      satCountOK: false,
    },
    // Add other tabs data here
  };

  const getStatusColor = (status) => {
    return status ? 'green' : 'red';
  };

  return (
    <div className="App">
      <div className="sidebar">
        {Object.keys(data).map((tab) => (
          <button
            key={tab}
            className={activeTab === tab ? 'active' : ''}
            style={{ backgroundColor: getStatusColor(data[tab].status) }}
            onClick={() => setActiveTab(tab)}
          >
            {tab.replace(/([A-Z])/g, ' $1').toLowerCase()}
          </button>
        ))}
      </div>
      <div className="main-content">
        <KeyValueTable data={data[activeTab]} />
      </div>
    </div>
  );
};

export default App;
